import {Dialog, withStyles, Box, Typography, makeStyles} from '@material-ui/core';
import '../../index.css'

const useStyles = makeStyles({
    component: {

    },
    leftComponent: {

    }
})

const style = {
    dialogPaper: {
        height: '95%',
        width: '60%',
        marginTop: '12%'
    }
}

const Login = ({classes}) => {
    const classname = useStyles();
    return(
        <Dialog
           open={true}
           classes={{paper: classes.dialogPaper}}
           BackdropProps={{style: {backgroundColor: 'unset'}}}
        >
        <Box>
            <Box>
                <Typography class="App"><h1>Autenticação de Usuário</h1></Typography>
            </Box>
            <Box>
               <div class="form-control App">
		           <label for="room">Informe quem é você: </label>
		           <select name="room" id="room" style={{textAlign: 'center'}}>
		           	  <option value="Consumidor">Consumidor</option>
		           	  <option value="Segurador">Segurador/Corretor</option>
		           	  <option value="Lojista">Lojista/Oficina</option>
		           	  <option value="Atendente">Vendedor/Atendente AUTOGLASS</option>
		           </select>
		       </div>
            </Box>
        </Box>

        </Dialog>
    )
}

export default withStyles(style)(Login);
